eval("{/**\r\n * Test Form JavaScript\r\n *\r\n * Обработка формы тестирования на возможность банкротства\r\n *\r\n * @package udsc\r\n * @since 1.0.0\r\n */\n\nclass TestFormHandler {\n  constructor(formId) {\n    this.form = document.getElementById(formId);\n    this.header = document.getElementById(formId + \"_header\");\n    if (!this.form) {\n      console.warn(\"Test form not found:\", formId);\n      return;\n    }\n    this.init();\n  }\n  init() {\n    this.setupStickyHeader();\n    this.setupFormSubmission();\n  }\n  setupStickyHeader() {\n    if (!this.header) return;\n    let originalTop = this.header.offsetTop;\n    const handleScroll = () => {\n      const scrollTop = window.pageYOffset;\n      if (scrollTop >= originalTop) {\n        this.header.classList.add(\"shadow-2xl\");\n      } else {\n        this.header.classList.remove(\"shadow-2xl\");\n      }\n    };\n    window.addEventListener(\"scroll\", handleScroll);\n    handleScroll(); // Initial call\n  }\n  setupFormSubmission() {\n    this.form.addEventListener(\"submit\", e => this.handleSubmit(e));\n  }\n  handleSubmit(e) {\n    e.preventDefault();\n    const submitBtn = document.querySelector(`button[form=\"${this.form.id}\"]`) || this.form.querySelector('button[type=\"submit\"]');\n    if (!submitBtn) return;\n    const originalText = submitBtn.innerHTML;\n\n    // Show loading state\n    submitBtn.disabled = true;\n    submitBtn.innerHTML = '<svg class=\"animate-spin w-4 h-4 mr-2\" fill=\"none\" viewBox=\"0 0 24 24\"><circle class=\"opacity-25\" cx=\"12\" cy=\"12\" r=\"10\" stroke=\"currentColor\" stroke-width=\"4\"></circle><path class=\"opacity-75\" fill=\"currentColor\" d=\"M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z\"></path></svg>Анализируем...';\n\n    // Simulate processing (replace with real AJAX)\n    setTimeout(() => {\n      this.showSuccess();\n      this.resetForm(submitBtn, originalText);\n    }, 2000);\n  }\n  showSuccess() {\n    alert(\"Спасибо за прохождение теста! Свяжемся с вами в ближайшее время.\");\n  }\n  resetForm(submitBtn, originalText) {\n    submitBtn.disabled = false;\n    submitBtn.innerHTML = originalText;\n    this.form.reset();\n  }\n}\n\n// Auto-initialize all test forms\ndocument.addEventListener(\"DOMContentLoaded\", function () {\n  const testForms = document.querySelectorAll('form[id^=\"bankruptcy-assessment-test\"]');\n  testForms.forEach(form => {\n    new TestFormHandler(form.id);\n  });\n});\n\n//# sourceURL=webpack://underscores/./src/js/test-form.js?\n}");

