    this.closeModal(); // Закрываем модальное окно\n      } else {\n        this.showNotification(result.data || \"Произошла ошибка при отправке отзыва\", \"error\");\n      }\n    } catch (error) {\n      console.error(\"Ошибка отправки формы:\", error);\n      this.showNotification(\"Произошла ошибка при отправке отзыва. Попробуйте еще раз.\", \"error\");\n    } finally {\n      // Восстанавливаем кнопку\n      submitButton.innerHTML = originalText;\n      submitButton.disabled = false;\n    }\n  }\n  validateForm(data) {\n    const errors = [];\n    if (!data.name || data.name.length < 2) {\n      errors.push(\"Имя должно содержать минимум 2 символа\");\n    }\n    if (!data.location || data.location.length < 2) {\n      errors.push(\"Укажите ваш город\");\n    }\n    if (!data.rating) {\n      errors.push(\"Выберите оценку\");\n    }\n    if (!data.debt || data.debt.length < 1) {\n      errors.push(\"Укажите сумму долга\");\n    }\n    if (!data.text || data.text.length < 10) {\n      errors.push(\"Отзыв должен содержать минимум 10 символов\");\n    }\n    if (!data.consent) {\n      errors.push(\"Необходимо согласие на обработку персональных данных\");\n    }\n    if (errors.length > 0) {\n      this.showNotification(errors.join(\"<br>\"), \"error\");\n      return false;\n    }\n    return true;\n  }\n  closeModal() {\n    // Ищем модальное окно и закрываем его\n    const modal = document.querySelector(\"#testimonial-modal\");\n    if (modal) {\n      // Если используется Radix UI или другой модальный компонент\n      const closeButton = modal.querySelector('[data-state=\"open\"] button[aria-label=\"Close\"]');\n      if (closeButton) {\n        closeButton.click();\n      } else {\n        // Fallback - скрываем модальное окно\n        modal.style.display = \"none\";\n        modal.setAttribute(\"data-state\", \"closed\");\n      }\n    }\n  }\n  showNotification(message, type = \"info\") {\n    // Удаляем существующие уведомления\n    const existingNotifications = document.querySelectorAll(\".notification\");\n    existingNotifications.forEach(notification => notification.remove());\n\n    // Создаем новое уведомление\n    const notification = document.createElement(\"div\");\n    notification.className = `notification fixed top-4 right-4 z-[10000] p-4 rounded-lg shadow-lg max-w-sm ${type === \"success\" ? \"bg-green-500 text-white\" : type === \"error\" ? \"bg-red-500 text-white\" : \"bg-blue-500 text-white\"}`;\n    notification.innerHTML = `\n      <div class=\"flex items-start\">\n        <div class=\"flex-shrink-0\">\n          ${type === \"success\" ? '<svg class=\"h-5 w-5\" fill=\"currentColor\" viewBox=\"0 0 20 20\"><path fill-rule=\"evenodd\" d=\"M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z\" clip-rule=\"evenodd\"></path></svg>' : type === \"error\" ? '<svg class=\"h-5 w-5\" fill=\"currentColor\" viewBox=\"0 0 20 20\"><path fill-rule=\"evenodd\" d=\"M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z\" clip-rule=\"evenodd\"></path></svg>' : '<svg class=\"h-5 w-5\" fill=\"currentColor\" viewBox=\"0 0 20 20\"><path fill-rule=\"evenodd\" d=\"M18 10a8 8 0 11-16 0 8 8 0 0116 0zm-7-4a1 1 0 11-2 0 1 1 0 012 0zM9 9a1 1 0 000 2v3a1 1 0 001 1h1a1 1 0 100-2v-3a1 1 0 00-1-1H9z\" clip-rule=\"evenodd\"></path></svg>'}\n        </div>\n        <div class=\"ml-3 flex-1\">\n          <p class=\"text-sm font-medium\">${message}</p>\n        </div>\n        <div class=\"ml-4 flex-shrink-0\">\n          <button class=\"inline-flex text-white hover:text-white/75 focus:outline-none\" onclick=\"this.parentElement.parentElement.parentElement.remove()\">\n            <svg class=\"h-4 w-4\" fill=\"currentColor\" viewBox=\"0 0 20 20\"><path fill-rule=\"evenodd\" d=\"M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z\" clip-rule=\"evenodd\"></path></svg>\n          </button>\n        </div>\n      </div>\n    `;\n    document.body.appendChild(notification);\n\n    // Анимация появления\n    setTimeout(() => {\n      notification.style.transform = \"translateX(0)\";\n      notification.style.opacity = \"1\";\n    }, 10);\n\n    // Автоматическое скрытие через 5 секунд\n    setTimeout(() => {\n      if (notification.parentElement) {\n        notification.style.transform = \"translateX(100%)\";\n        notification.style.opacity = \"0\";\n        setTimeout(() => {\n          if (notification.parentElement) {\n            notification.remove();\n          }\n        }, 300);\n      }\n    }, 5000);\n  }\n}\n\n// Автоматическая инициализация всех форм отзывов\ndocument.addEventListener(\"DOMContentLoaded\", function () {\n  const testimonialForms = document.querySelectorAll('form[id^=\"testimonial-modal-form\"]');\n  testimonialForms.forEach(form => {\n    new TestimonialFormHandler(form.id);\n  });\n});\nconsole.log(\"Testimonial form loaded\");\n\n//# sourceURL=webpack://underscores/./src/js/testimonial-form.js?\n}");

